import { Component } from '@angular/core';

@Component({
  selector: 'app-skills-box-list',
  templateUrl: './skills-box-list.component.html',
  styleUrls: ['./skills-box-list.component.css']
})
export class SkillsBoxListComponent {
  listOfTitles = [
    "Bases de données",
    "Langues",
  ]
  listOflogos = [
    "database.png",
    "database.png",
  ]
  listOfSkills = [
    ["MySql", "Symfony"],
    ["Français", "Anglais"]
  ]
  listOfSkillLogos = [
    ["assets/logos/mysql.png", "assets/logos/simfony.png"],
    ["assets/logos/french.png", "assets/logos/english.png"],
  ]
}
